// ============================================================
// taste chart js
(function() {
    // cart data
    var chartdata =  [3,3,1,2,4,3,2,4,4,2];
    // data
    var data = {
        labels: ["", "", "", "", "", "", "", "", "", ""],
        datasets: [{
            data: chartdata,
            borderWidth: 0,
            borderColor: "transparent",
        }]
    };
    // options
    var options = {
        aspectRatio: 1,
        animation: false,
        scale: {
            angleLines: {
                display: false,
            },
            gridLines:{
                display: true,
                color: "#BBB4A4"
            },
            ticks: {
                display: false,
                suggestedMin: -1,
                suggestedMax: 5
            },
            pointLabels: {
                fontColor: "#1b1717",
                fontSize: 12
            },
        },
        elements:{
            line: {
                backgroundColor: "rgba(185, 174, 142, 0.3)",
            },
            point: {
                radius: 5,
                hoverRadius: 5,
                backgroundColor: "#000000",
                hoverBackgroundColor: "#C76A15",
            }
        },
        tooltips:{
            titleMarginBottom: 0,
            callbacks: {
                title: function(tooltipItem, data) {
                    return tooltipItem[0].value;
                },
                label: function(tooltipItem, data) {
                    return "";
                }
            },
        },
        legend: {
            display: false,
        },
        dragData: true,
        dragX: false,
        dragDataRound: 0,
        dragOptions: {
            showTooltip: true
        },
        onDrag: function (e, datasetIndex, index, value) {
            if(value < 0){
                e.preventDefault();
                return false;
            }
        },
        onDragEnd: function (e, datasetIndex, index, value) {
            // on drag end
        }
        , animationSteps: 300
        , scaleFontSize: 16
        , pointLabelFontSize: 14
        , tooltipFontSize: 12
        , tooltipTitleFontSize: 12
        , pointDotRadius: 1
        , pointLabelFontFamily: "proxima-nova"
    };
    // create chart
    var ctx = $("[data-taste-chart]");
    if (ctx.length > 0) {
        if ($("[data-taste-chart]").attr("data-taste-chart-nodrag") === "true") {
            options.dragData = false;
        }
        var radarChart = new Chart(ctx, {
            type: "radar",
            data: data,
            options: options
        });
    }
})();

